import './App.css';
//import { getProducts } from './components/GetData';
import { useEffect, useState } from 'react';
import { ProductImg } from './components/styled/StyledProductsPage';

function App() {
  const [products, setProducts] = useState();

  useEffect(() => {
    const getProducts = async () => {
      await fetch('https://fakestoreapi.com/products')
            .then(res=>res.json())
            .then(json=>setProducts(json));
    }
    getProducts();
  })

  return (
    <div className="App">
      {products[0].title}
      {products[0].description}
      <ProductImg type="img" src={products[0].image} ></ProductImg>
    </div>
  );
}

export default App;
